 MEDIA \nInstagram - http://www.instagram.com/SapphireOfficial\nSnapchat - http://www.snapchat.com/add/sapphiresing\nTwitter - http://www.twitter.com/SapphireSing\nFacebook - http://www.facebook.com/SapphireUK\nSoundcloud - http://www.soundcloud.com/SapphireUK\n\nMY WEBSITE  - http://www.SapphireOfficial.com\n\nThank you to:\nAcoustic instrumental - Alawn\nAll the Walkers (see original video for full list!)\nVideo actors - Charlie, Toby, Daisy and Skye\n\nUnity - Alan x Walkers ft. Sapphire LYRICS\n\n[Verse 1]\nIn the dark of night\nThe stars light up the sky\nWe see them flying free\nThat's just like you and me\n\n[Pre-Chorus]\nEveryone is lonely sometimes (Sometimes)\nBut I would walk a thousand miles to see your eyes\nYou are not alone, we are family (Family)\nHold me, let's escape all this reality\n\n[Chorus]\nYou are my symphony\nBy your side, we are unity\nYou are my energy\nMy guiding light, we are unity\n(We are, we are) We are unity\n(We are, we are) We are unity\n\n[Verse 2]\nAlthough the rain might pour\nA thunder starts to roar\nThe lightnin' wakes the wave\nBut through it, we are brave\n\n[Pre-Chorus]\nEveryone is lonely sometimes (Sometimes)\nBut I would walk a thousand miles to see your eyes\nYou are not alone, we are family (Family)\nHold me, let's escape all this reality\n\n[Chorus]\nYou are my symphony\nBy your side, we are unity (We are unity)\nYou are my energy\nMy guiding light, we are unity\n(We are, we are) We are unity\n(We are, we are) We are unity\nWe are unity\n\n[Chorus]\nYou are my symphony (We are)\nBy your side (We are, we are unity, unity)\nYou are my energy (We are)\nMy guiding light (We are), unity\nWe are unity\nWe are unity\n\n#Unity #Sapphire #AlanXWalkers"},"lengthSeconds":"180","ownerProfileUrl":"http://www.youtube.com/@sapphireofficial","externalChannelId":"UCrbrN66-0KK6DaLJg2t5fvQ","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF" he incredible opportunity, and to all the Walkers:) Love you all endlessly.\nBig love, Sapphire x\n\nSOCIAL MEDIA \nInstagram - /sapphireofficial\nSnapchat - /sapphiresing\nTwitter - /sapphiresing\nFacebook - /sapphireuk\nSoundcloud - /sapphireuk\n\nMY WEBSITE  - http://www.SapphireOfficial.com\n\nThank you to:\nAcoustic instrumental - Alawn\nAll the Walkers (see original video for full list!)\nVideo actors - Charlie, Toby, Daisy and Skye\n\nUnity - Alan x Walkers ft. Sapphire LYRICS\n\n[Verse 1]\nIn the dark of night\nThe stars light up the sky\nWe see them flying free\nThat's just like you and me\n\n[Pre-Chorus]\nEveryone is lonely sometimes (Sometimes)\nBut I would walk a thousand miles to see your eyes\nYou are not alone, we are family (Family)\nHold me, let's escape all this reality\n\n[Chorus]\nYou are my symphony\nBy your side, we are unity\nYou are my energy\nMy guiding light, we are unity\n(We are, we are) We are unity\n(We are, we are) We are unity\n\n[Verse 2]\nAlthough the rain might pour\nA thunder starts to roar\nThe lightnin' wakes the wave\nBut through it, we are brave\n\n[Pre-Chorus]\nEveryone is lonely sometimes (Sometimes)\nBut I would walk a thousand miles to see your eyes\nYou are not alone, we are family (Family)\nHold me, let's escape all this reality\n\n[Chorus]\nYou are my symphony\nBy your side, we are unity (We are unity)\nYou are my energy\nMy guiding light, we are unity\n(We are, we are) We are unity\n(We are, we are) We are unity\nWe are unity\n\n[Chorus]\nYou are my symphony (We are)\nBy your side (We are, we are unity, unity)\nYou are my energy (We are)\nMy guiding light (We are), unity\nWe are unity\nWe are unity\n\n#Unity #Sapphire #AlanXWalkers","commandRuns":[{"startIndex":523,"length":22,"onTap":{"innertubeCommand":{"clickTrackingParams":"CI4FEM2rARgBIhMIh-qmg6yshgMVBPdCBR1uwwQPSNjv3evrwYfFag==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbXBjYj . Sapphire LYRICS\n\n[Verse 1]\nIn the dark of night\nThe stars light up the sky\nWe see them flying free\nThat's just like you and me\n\n[Pre-Chorus]\nEveryone is lonely sometimes (Sometimes)\nBut I would walk a thousand miles to see your eyes\nYou are not alone, we are family (Family)\nHold me, let's escape all this reality\n\n[Chorus]\nYou are my symphony\nBy your side, we are unity\nYou are my energy\nMy guiding light, we are unity\n(We are, we are) We are unity\n(We are, we are) We are unity\n\n[Verse 2]\nAlthough the rain might pour\nA thunder starts to roar\nThe lightnin' wakes the wave\nBut through it, we are brave\n\n[Pre-Chorus]\nEveryone is lonely sometimes (Sometimes)\nBut I would walk a thousand miles to see your eyes\nYou are not alone, we are family (Family)\nHold me, let's escape all this reality\n\n[Chorus]\nYou are my symphony\nBy your side, we are unity (We are unity)\nYou are my energy\nMy guiding light, we are unity\n(We are, we are) We are unity\n(We are, we are) We are unity\nWe are unity\n\n[Chorus]\nYou are my symphony (We are)\nBy your side (We are, we are unity, unity)\nYou are my energy (We are)\nMy guiding light (We are), unity\nWe are unity\nWe are unity\n\n#Unity #Sapphire #AlanXWalkers","commandRuns":[{"startIndex":523,"length":22,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCMQ040EGAQiEwiH6qaDrKyGAxUE90IFHW7DBA9I2O_d6-vBh8Vq","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqazZIeG9IelZ3NThhV1NLYXNvRERYeG8xTGhJQXxBQ3Jtc0tsVUVvdmxoZzQ3U1doQ2xDUUtUaFNicTAzS0hqdU95ZEJiLWtFOHNFRmFkOEp6SXZyVTJzUjVodTU0UG5fVjZnSGRaeVRfUGhjNkVoMDgzcVY0cGlBWVpOY3htM19taXI3cExsY2YzNDN6Y0xaV0Q3Yw\u0026q=http%3A%2F%2Fwww.instagram.com%2FSapphireOfficial\u0026v=aooeDr13d9g","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqazZIeG9IelZ3NThhV1NLYXNvRERYeG8xTGhJQXxBQ3Jtc0
